import React from 'react';
import './App.css';

import Jumbotron from './allComponents/jumbotron.component.js';
import Nav from './allComponents/nav.component.js';
import TextBox from './allComponents/textBox.component.js';
import Tile from './allComponents/clickTile.component.js';

function App(){

  return (
    <div className="App">
      <header className="App-header">
      <Nav/>
      <Jumbotron/>
      <br/>
      <Tile source={'../imgs/microgreens/micro3.jpeg'} title={'Microgreens'}/>
      <TextBox value={'A forward thinking team helping the people and our ecosystem rejuvenate their health. We are your source for locally grown, fresh microgreens. We establish pollinator gardens in your local communities. Feeding those small as bees to those big as Shaq, from microgreens to evergreens, we are Evolution Urban Grows!'} />
        <p>
          This will soon be EUG
        </p>
        <a
          className="App-link"
          href="http://evogrows.com"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn about EUG
        </a>
      </header>
    </div>
  );
}

export default App;
